(1, 'Brigs Nucleus', 'BRIG', 'Headquartered in Pune, Maharashtra, the Volkswagen Group in India is represented by five brands: SKODA, Volkswagen, Audi, Porsche and Lamborghini. The Indian journey began with the launch of SKODA in 2001. Audi and Volkswagen entered in 2007, while Lamborghini and Porsche were introduced in 2012. Today, the Group upholds its mantle of superior engineering, with plants in Pune and Aurangabad working seamlessly to manufacture the world\'s most loved cars.', '2019-07-16 06:04:15', '2019-12-05 06:51:36', 0),
